// Need improvement
pub fn find_cheapest_price(n: i32, flights: Vec<Vec<i32>>, src: i32, dst: i32, k: i32) -> i32 {
    use std::cmp::min;
    use std::collections::HashMap;
    let mut neighbours = Vec::<HashMap<usize, i32>>::new();
    for i in 0..n {
        neighbours.push(HashMap::new());
    }

    for flight in flights {
        neighbours[flight[0] as usize].insert(flight[1] as usize, flight[2]);
    }

    fn lowest_price(neighbours: &Vec<HashMap<usize, i32>>, src: usize, dst: usize, k: i32, cost_max: i32) -> (bool, i32) {
        if cost_max <= 0 {
            return (false, 0)
        }

        let mut found = false;
        let mut lowest = cost_max;

        if k > 0 {
            for (&interm, &price) in neighbours[src].iter() {
                let (next_found, next_lowest) = lowest_price(neighbours, interm, dst, k-1, lowest-price);
                if next_found {
                    found = true;
                    lowest = min(lowest, price+next_lowest);
                }
            }
        } else {
            match neighbours[src].get(&dst) {
                None => {},
                Some(&price) => {
                    if price < lowest {
                        found = true;
                        lowest = price;
                    }
                },
            }
        }

        if found {
            (true, lowest)
        } else {
            (false, 0)
        }
    }

    let mut found = false;
    let mut lowest = 1_000_000_000;
    for j in 0..=k {
        let (found1, lowest1) = lowest_price(&neighbours, src as usize, dst as usize, j, lowest);
        if found1 {
            found = true;
            lowest = lowest1;
        }
    }

    if found {
        lowest
    } else {
        -1
    }
}

